function Dashboard(props) {

    return ( 
        <>
            <div className="flex h-full w-full">
                <div className="w-full basis-1/4 ">
                    <SideMenu setData={props.setData} />
                </div>
                <div className=" w-full basis-100">
                    <Inventory />
                    <Folder />
                </div>
            </div>
        </>
     );
}

